import React, { Component } from 'react';

class chielduser extends Component {
    render() {
        return (
            <div id="content">
            <div className="inner" >
                <div className="row">
                    <div className="col-lg-12">

                    <h1>Dashbord</h1>
                        


                    </div>
                </div>
                <hr />
            </div>
        </div>
        );
    }
}

export default chielduser;
